INSERT [dbo].[ItemType_Speaker] ([Id], [Name], [Description], [Sort], [WebsiteUrl], [WebsiteTitle], [Image], [Company]) VALUES (N'1', N'Asger Munkholm Hojfeldt', N'<p>Asger Munkholm Hojfeldt is the Product Manager of Dynamicweb. Having worked within the Dynamicweb sphere for around 9 years Asger knows a lot about the platform, the partners and the customers. Asgers focus is mainly Ecommerce and Online Marketing and he loves when IT optimizes a customers business.</p>
', 1, N'', N'', N'/Files/Images/speakers/asger.jpg', N'Dynamicweb')
INSERT [dbo].[ItemType_Speaker] ([Id], [Name], [Description], [Sort], [WebsiteUrl], [WebsiteTitle], [Image], [Company]) VALUES (N'2', N'Mikkel Ricky', N'<p>Mikkel has worked with web programming and web technologies ever since taking his first steps onto the internet back in the summer of ''95. Before joining Dynamicweb, Mikkel worked in the publishing industry for many years, and he''s no stranger to the challenges we''re facing with getting good content onto the web and present it in useful and beautiful ways.</p>
', 2, N'', N'', N'/Files/Images/speakers/mikkel.jpg', N'Dynamicweb')
INSERT [dbo].[ItemType_Speaker] ([Id], [Name], [Description], [Sort], [WebsiteUrl], [WebsiteTitle], [Image], [Company]) VALUES (N'3', N'Jeppe Eriksson Agger', N'<p>Jeppe Eriksson Agger has been with Dynamicweb for more than 5 years. In that time, he has helped to bring a lot of core Dynamicweb functionality to the product. He was one of the main forces behind Shopping Cart v2 and the architect behind Product Categories. Recently, Jeppe subjected Ecommerce to a major performance raid and worked on Email Marketing and the upcoming Campaigns module.</p>

<p>Jeppe has also been known to stalk the forum late at night.</p>
', 3, N'', N'', N'/Files/Images/speakers/jeppe.jpg', N'Dynamicweb')
INSERT [dbo].[ItemType_Speaker] ([Id], [Name], [Description], [Sort], [WebsiteUrl], [WebsiteTitle], [Image], [Company]) VALUES (N'4', N'Torben Johannesen', N'<p>Torben Johannesen is the Chief Technology Officer of Dynamicweb. Having more than 20 years'' experience in managing IT projects and organizations Torben has a strong focus on leveraging the full potential of technology and organization - in order to deliver optimal IT solutions to the business.</p>
', 4, N'', N'', N'/Files/Images/speakers/torben.jpg', N'Dynamicweb')
INSERT [dbo].[ItemType_Speaker] ([Id], [Name], [Description], [Sort], [WebsiteUrl], [WebsiteTitle], [Image], [Company]) VALUES (N'5', N'Nicolai Hoeg Pedersen', N'<p>Nicolai Pedersen is co-founder of Dynamicweb and is in charge of product development.</p>
', 5, N'', N'', N'/Files/Images/speakers/nicolai.jpg', N'Dynamicweb')
INSERT [dbo].[ItemType_Speaker] ([Id], [Name], [Description], [Sort], [WebsiteUrl], [WebsiteTitle], [Image], [Company]) VALUES (N'6', N'Janne Jul Jensen', N'<p>Janne Jul Jensen is Senior Interaction Designer with Trifork A/S. She specialises in usability and interaction design, and applies her expertise primarily to the mobile app projects within Trifork, such as apps for Danske Bank, Radiometer A/S, Roskilde Festival, Lemvigh-MÅller, KMD and DSB. She is a sought after speaker by educational institutions, conferences, the public sector and companies. She also gives courses internally and externally on her topics of expertise and is the founder a user group on Design &amp; Usability (www.trifork.com/design-usability (in Danish)), where peers can meet and learn from each other.</p>

<p>Previously she was a researcher at Aalborg University for seven years, successfully collaborating nationally and internationally with academia and privately held companies on a number of projects, resulting in a number of publications. Furthermore, she has reviewed for conferences and journals and co-organized smaller conferences. Apart from her research, she has taught HCI to undergraduate and graduate students and supervised student projects on these topics. She earned her Ph.D. degree in 2009 and a M.Sc. in Software Engineering in 2003, both from Aalborg University.</p>
', 6, N'', N'', N'/Files/Images/speakers/janne.jpg', N'Trifork')
INSERT [dbo].[ItemType_Speaker] ([Id], [Name], [Description], [Sort], [WebsiteUrl], [WebsiteTitle], [Image], [Company]) VALUES (N'7', N'Jonas Krarup Dam', N'<p>Jonas Dam has been working as a system developer with Dynamicweb for 3 years. During this time, he has focused on improving the data integration capabilities, and the Ecommerce functionality of Dynamicweb.</p>
', 7, N'', N'', N'/Files/Images/speakers/jonas.jpg', N'Dynamicweb')
INSERT [dbo].[ItemType_Speaker] ([Id], [Name], [Description], [Sort], [WebsiteUrl], [WebsiteTitle], [Image], [Company]) VALUES (N'8', N'Jan Neerbek', N'<p>Jan Neerbek, Senior Research and Innovation scientist from the Alexandra Institute; a Danish company specialized in facilitating projects between companies and Universities and/or other cutting edge research institutions.</p>

<p>Jan Neerbek has worked for many years with distributed solutions, from large-scale servers to embedded devices. Jan Neerbek has recently participated in several projects involving Recommendation and Big Data helping to scale solutions for recommendation to large datasets. He is author on the article "Message-driven FP-growth", on how-to scale Market-Basket recommendations.</p>
', 8, N'', N'', N'/Files/Images/speakers/jan.jpg', N'Alexandra Institute')
INSERT [dbo].[ItemType_Speaker] ([Id], [Name], [Description], [Sort], [WebsiteUrl], [WebsiteTitle], [Image], [Company]) VALUES (N'9', N'Klavs Martens', N'<p>Klavs Martens is the Senior System Architect of Dynamicweb and one of the original developers of Ecommerce and the Extensibility framework. He''s mainly focusing on the architecture, cloud, and developer tools. Klavs has been working at Dynamicweb for five years.</p>
', 9, N'', N'', N'/Files/Images/speakers/klavs.jpg', N'Dynamicweb')
